const tasks = [
    {
        text: 'this is a test',
        id: 1
    },
    {
        text: 'this is another test',
        id: 2
    }
]
export const Tasks = () => {
  return (
    <>
        {tasks.map( (task) => (
            <h3 key={task.id}>{task.text}</h3>
        ))}
    </>

  )
}
export default Tasks
